import React from "react";
import styles from "./Signup.css";

const Signup = () => {
  return (
    <div>
      <div className="sign-up-part">
        <div>
          <div className="newton-imge">
            <img
              className="newton-imgee"
              src="	https://newtonslab.in/wp-content/uploads/2024/01/Logo-with-text-dark-1.png"
            ></img>
          </div>
          <div className="create-txt">
            <h>Create an Account</h>
          </div>
          <hr></hr>
          <div className="signup-container">
            {/* Input fields for name, email, and password */}
            <input className="elements-txt" type="text" placeholder="Full Name" />
            <input className="elements-txt" type="email" placeholder="E-mail" />
            <input className="elements-txt" type="password" placeholder="Password" />
            {/* Button to submit the signup form */}
            <button className="creat-button">Create Account</button>
          </div>
        </div>
      </div>
      <div className="Newon-img-part">
        <img className="right-img" src=""></img>
      </div>
    </div>
  );
};

export default Signup;
